import React from "react";
import ReactDOM from "react-dom";

import Search from "./search";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Search />
    </div>
  );
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
